import React from 'react';
import PropTypes from 'prop-types';

const foodILike = [
  {
    id: 1,
    name: 'KIMCHI',
    image:
      'data:image/jpeg;base64,',
    rating: 5
  },
  {
    id: 2,
    name: 'Gimbap',
    image:
      'data:image/jpeg;base64,',
    rating: 3.5
  }
];

const Food = ({ name, picture, rating }) => {
  return (
    <div>
      <h1>I like {name}</h1>
      <h4>{rating} / 5.0</h4>
      <img src={picture} alt={name} />
    </div>
  );
};

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired
};

const App = () => {
  return (
    <div>
      {foodILike.map(dish => {
        return (
          <Food
            key={dish.id}
            name={dish.name}
            picture={dish.image}
            rating={dish.rating}
          />
        );
      })}
    </div>
  );
};

export default App;
